import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import PayrollForm from './components/payroll-form/payroll-form.jsx'; // Added .jsx extension
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="app-header">
          <h1>Employee Payroll</h1>
        </header>
        <Routes>
          <Route path="/add-employee" element={<PayrollForm />} />
          <Route path="/" element={<div className="welcome-message">Welcome to Employee Payroll! <Link to="/add-employee" className="add-link">Add Employee</Link></div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
